CREATE FUNCTION public.get_or_create_company(p_company_name text) RETURNS integer
    LANGUAGE plpgsql
    AS $$
DECLARE
    v_company_id INT;
BEGIN
    -- This is the preferred way to handle "get or create" in a single atomic step.
    WITH new_row AS (
        INSERT INTO companies (company_name)
        VALUES (p_company_name)
        ON CONFLICT (company_name) DO NOTHING
        RETURNING id
    )
    SELECT id INTO v_company_id FROM new_row
    UNION ALL
    SELECT id FROM companies WHERE company_name = p_company_name AND v_company_id IS NULL
    LIMIT 1;

    RETURN v_company_id;
END;
$$;


